import React from 'react';
import { useSelector } from 'react-redux';

const Employees = () => {
    const emps = useSelector((state) => state.emps);
    return (
        <ul class="list-group"> 
            {emps.map((emp) => (<li class="list-group-item">{emp}</li>))}    
        </ul>
    );
};

export default Employees;
